import React from 'react';

const Recipe = ({title, image, ingredients}) => {
   return (
      <div>
	  <h1>{ title }</h1>
	  <img src = { image }/>
	  <ul>{ ingredients.map(ingredient => (
	    <li>{ ingredient.text }</li>
	  ))}</ul>
	  </div>
	); 
};

export default Recipe;
